import React from "react";
import { TouchableOpacity, View, Image, StyleSheet } from "react-native";
import { Data } from "../../models/Data";

interface Props {
  item: Data;
  index: number;
  disabled?: boolean;
  onPress?: () => void;
}
const Card = ({ item, index, disabled, onPress }: Props) => {
  return (

      <View style={styles.cardContainer}>
        <Image
          source={{
            uri: item.picture.thumbnail,
          }}
          style={styles.image}
        />
        <View style={styles.card}>

        </View>
      </View>

  );
};

const styles = StyleSheet.create({
  cardContainer: {
    flexDirection: "row",
    justifyContent: "space-between",
    backgroundColor: "#fff",
    height: 170,
    width: "100%",
    padding: 15,
    borderRadius: 30,
    alignItems: "center",
    marginVertical: 20,
  },
  card: {
    flexDirection: "row",
  },
  image: {
    height: 100,
    width: 100,
    borderRadius: 80,
  },
  description: {
    fontWeight: "bold",
    padding: 4,
  },
  tail: {
    padding: 4,
    width: 120,
  },
});

export default Card;
